import React from 'react';
import { Router } from '@reach/router';

const Home = () => (
    <p>
        This is the home
    </p>
);

const Lab = () => (
    <p>
        This is the lab
    </p>
);

const App = () => (
    <Router>
        <Home path='/' />
        <Lab path='/lab' />
    </Router>
);

export default App;
